import React, { useState } from 'react';
import styled from 'styled-components';
import { useGlobalContext } from '../../context/globalContext';
import { book, food, medical, freelance, piggy, money, bitcoin, card, yt, circle, clothing, tv, takeaway, stocks } from '../../utils/Icons';

function History() {
    const { incomes, expenses } = useGlobalContext();
    const [searchTerm, setSearchTerm] = useState('');
    const [filter, setFilter] = useState('All');

    const filteredHistory = [...incomes, ...expenses]
        .filter(item => filter === 'All' || item.type === filter.toLowerCase())
        .filter(item => 
            item.category.toLowerCase().includes(searchTerm.toLowerCase()) ||
            item.description.toLowerCase().includes(searchTerm.toLowerCase()) ||
            new Date(item.date).toLocaleDateString().includes(searchTerm.toLowerCase()) ||
            item.amount.toString().includes(searchTerm.toLowerCase())
        )
        .sort((a, b) => new Date(b.date) - new Date(a.date));

    const getIcon = (category, type) => {
        if (type === 'expense') {
            switch (category.toLowerCase()) {
                case 'education':
                    return book;
                case 'groceries':
                    return food;
                case 'health':
                    return medical;
                case 'subscriptions':
                    return tv;
                case 'takeaways':
                    return takeaway;
                case 'clothing':
                    return clothing;
                case 'travelling':
                    return freelance;
                case 'other':
                    return circle;
                default:
                    return '';
            }
        } else {
            switch (category.toLowerCase()) {
                case 'salary':
                    return money;
                case 'freelancing':
                    return freelance;
                case 'investments':
                    return stocks;
                case 'stocks':
                    return stocks;
                case 'bitcoin':
                    return bitcoin;
                case 'bank':
                    return card;
                case 'youtube':
                    return yt;
                case 'other':
                    return piggy;
                default:
                    return '';
            }
        }
    };

    return (
        <HistoryStyled>
            <h2>Transaction History</h2>
            <div className="search-filter-container">
                <input
                    type="text"
                    placeholder="Search.."
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
                <button className="search-button">Search</button>
                <select value={filter} onChange={(e) => setFilter(e.target.value)}>
                    <option value="All">All</option>
                    <option value="Income">Income</option>
                    <option value="Expense">Expense</option>
                </select>
            </div>
            <div className="table-responsive">
                <table>
                    <thead>
                        <tr>
                            <th>Category</th>
                            <th>Date</th>
                            <th>Description</th>
                            <th>Amount</th>
                        </tr>
                    </thead>
                    <tbody>
                        {filteredHistory.map((item) => (
                            <tr key={item._id}>
                                <td>
                                    <span className="icon">{getIcon(item.category, item.type)}</span>
                                    {item.category}
                                </td>
                                <td>{new Date(item.date).toLocaleDateString()}</td>
                                <td>{item.description}</td>
                                <td className={`amount ${item.type === 'expense' ? 'negative' : 'positive'}`}>
                                    ${item.type === 'expense' ? '-' : '+'}{Math.abs(item.amount)}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </HistoryStyled>
    );
}

const HistoryStyled = styled.div`
    background-color: #ffffff; 
    padding: 5px;
    border-radius: 8px;
    font-family: 'Segoe UI', sans-serif;

    h2 {
        margin-top: 2rem;
        margin-left: 1rem;
        color: #222260;
        margin-bottom: 16px;
        font-size: 1.5rem;
    }

    .search-filter-container {
        display: flex;
        align-items: center;
        margin-bottom: 2rem;
        padding: 0 1rem;

        input[type="text"] {
            padding: 10px;
            border-radius: 10px;
            border: 1px solid #ccc;
            flex: 1;
            margin-right: 0.3rem;
            font-family: 'Segoe UI', sans-serif;
        }

        select {
            background-color: #222260;;
            color: white;
            padding: 10px;
            border-radius: 10px;
            border: 1px solid #ccc;
            font-family: 'Segoe UI', sans-serif;
        }
    }

    .table-responsive {
        overflow-x: auto;
    }

    table {
        width: 100%;
        border-collapse: collapse;

        th, td {
            padding: 12px 16px;
            text-align: left;
            font-family: 'Segoe UI', sans-serif;
            border: none;
        }

        thead th {
            color: #222260;
            font-weight: bold;
            padding: 10px;
        }

        tr:last-child td {
            border-bottom: none;
        }

        .icon {
            font-size: 20px;
            margin-right: 8px;
            vertical-align: middle;
        }

        .amount {
            font-weight: bold;
            &.positive {
                color: green;
            }
            &.negative {
                color: red;
            }
        }
    }
`;

export default History;
